Express-winston middleware error on GET and POST request to mongoDB<p>I have the following structure:</p>

<p>logger.js:</p>

<pre><code>const logger = module.exports = require('winston')

logger.add(new logger.transports.File(
{
    name: 'debug-file',
    filename: 'log.log',
    level: 'debug',
    handleExceptions: true,
    humanReadableUnhandledException: true,
    exitOnError: true,
    json: false,
    maxsize: 104857600,
    maxfiles: 5
}))

logger.add(new logger.transports.Console(
{
    name: 'error-console',
    level: 'error',
    handleExceptions: true,
    humanReadableUnhandledException: true,
    exitOnError: true
}))
</code></pre>

<p>server.js:</p>

<pre><code>const port = process.env.PORT || 5000;

const logger = require('./logger.js')
const database = require('./database/createDatabase.js')({ logger })
const app = require('./app/createExpressApp.js')
const server = require('http').createServer()

server
    .on('request', app)
    .on('listening', function() {
        const addr = this.address()
        const bind = typeof addr === 'string' ? `pipe ${addr}` : `port ${addr.port}`
        logger.info(`Listening on ${bind}`)
    })
    .on('error', function(error) {
        if (error.syscall !== 'listen') throw error
        const addr = this.address() || { port }
        const bind = typeof addr === 'string' ? `pipe ${addr}` : `port ${addr.port}`
        switch (error.code) {
            case 'EACCES':
                logger.error(`${bind} requires elevated privileges`)
                process.exit(1)
            case 'EADDRINUSE':
                logger.error(`${bind} is already in use`)
                process.exit(1)
            default:
                throw error
        }
    })
    .listen(port)
</code></pre>

<p>createDatabase.js:</p>

<pre><code>const mongoose = require('mongoose')
const glob = require('glob')
const path = require('path')

module.exports = ({ logger }) =&gt; {

    const url = process.env.ATLAS_URI
            || "mongodb+srv://(removed for stackoverflow question)"

    mongoose.connect(url)

    const db = glob.sync('./schemas/**/*.js', { cwd: __dirname })
    .map(filename =&gt; {
        return {
            schema: require(filename),
            name: path
                .basename(filename)
                .replace(path.extname(filename), ''),
        }
    })
    .map(({name, schema}) =&gt; mongoose.model(name, schema))
    .reduce((db, model) =&gt; {
        return {
            ...db,
            [model.modelName]: model,
        }
    }, {})

    mongoose
    .connection
    .on('error', error =&gt; {
        throw error
    })
    .once('open', () =&gt; logger.info(`MongoDB connection established successfully!`) &amp;&amp; 
        console.log(`MongoDB connection established successfully!`))

    return db
}
</code></pre>

<p>and finally getUsers.js:</p>

<pre><code>const Router = require('express').Router

// export to router
module.exports = Router({mergeParams: true})
.get('/v1/users', async (req, res, next) =&gt; {
    try {
        const users = await req.db.User.find()
        res.send(users)
    }
    catch (error) {
        next(error)
    }
})
</code></pre>

<p>I have triple checked folder structure, syntax and everything else I can think of, but think I lack understanding of winston. I get the following error when I go to perform GET request for Users:</p>

<pre><code>{"error":{},"level":"error","message":"uncaughtException: transports or a winstonInstance are required by express-winston middleware
</code></pre>

<p>I have a feeling its a rudimentary error and I'm missing something simple. Anyone have ideas on what would be causing the error?</p>

