Scaling Spring WebFlux with Tailable ReactiveMongo<p>I am building a server sent events endpoint that will keep open connections for a long period (1h+) continuously sending events in realtime. I am using reactive Mongo to share all DB updates between all application instances. As far as I see on each HTTP request, a new Mongo connection is open. This is not salable because DB connection pool is limited. Using defaults starts to crash at 500 http requests (500 open SSE http connections => 500 DB connections).</p>

<p>How can I make this scalable to handle 50000+ simultaneous http requests per instance using the Tailable query? Strangely I didn't find anything online regarding this issue. Is there any feature built in the java mongo driver to share queries on one connection?</p>

<p>Simply, this is the code I am testing with: a simple GET endpoint that returns a Flux of records from a Tailable MongoDB query:</p>

<pre><code>//controller endpoint
@GetMapping(value = "location/{id}", produces = MediaType.TEXT_EVENT_STREAM_VALUE)    
Flux&lt;Location&gt; getLocationById(@PathVariable String id) {
    return locationsRepository.findById(id)
}
</code></pre>

<p>and</p>

<pre><code>//repository
@Repository
public interface LocationsRepository extends ReactiveCrudRepository&lt;Location,String&gt; {
    @Tailable
    Flux&lt;Location&gt; findById(String id);
}
</code></pre>

<p>Mongo has default configurations and of course <code>location</code> is an indexed capped collection.</p>

